column13:
Compounds of the formula (I):
   and salts thereof; wherein 
    A is a group NR³SO₂ or SO₂NR³; B is C₁₋₆alkylene; 
    Y is CO₂H or a group hydrolysable to CO₂H; 
    R¹ is phenyl optionally substituted by one or more substituents chosen from the group comprising halogen, C₁₋₄alkyl, C₁₋₆acyl, C₁₋₄alkoxy, nitro and trifluoromethyl, provided that when R¹ is phenyl substituted by two or more substituents, no more than one substituent can be meta-trifluoromethyl; 
    R² is hydrogen or one or more C₁₋₄alkyl substituents; and R³ is hydrogen or C₁₋₆alkyl.
